  false,\n\t\"url\": null,\n\t\"notes\": \"This data layer was provided to CSMW by
  Moffatt Nichol as part of their efforts related to compiling the San Diego Coastal
  RSM Plan. The data was reportedly collected by Thales Geosolutions, Inc as High
  Resolution Multibeam acoustic Backscatter and processed by KTU+A for the San Diego
  Region Nearshore Coastal Zone Program.These data are intended for science researchers,
  students, policy makers, and the general public. The data can be used with GIS or
  other software to display the seafloor substrate types of the Nearshore Coastal
  Zone of the San Diego Region.Dataset was submitted to CSMW by SANDAG as part of
  the San Diego County Coastal Regional Sediment Management Plan (2009).\",\n\t\"license_title\":
